import React from "react";

const Navbar = () => {
	return (
		<div className="navbarContainer">
			<div className="navLogo">
				<h3>TJ</h3>
			</div>
			<nav className="navBar">
				<a>Home</a>
				<a>About Me</a>
				<a>Projects</a>
				<a>Resume</a>
				<a>Contact</a>
			</nav>
		</div>
	);
};

export default Navbar;
